issues.each do
  |
    project,
    priority,
    tag,
    type,
    state,
    summary,
    employee,
    created_at,
    date_start_dev,
    date_end_dev,
    date_start_test,
    date_end_test
  |

  record = Issue.create(
    project: Project.find_by_name(project),
    priority_issue: PriorityIssue.find_by_name(priority),
    employee: Employee.find_by_full_name(employee),
    tags: [Tag.find_by_name(tag)],
    type_issue: TypeIssue.find_by_name(type),
    state_issue: StateIssue.find_by_name(state),
    summary: summary,
    created_at: prepare_time(created_at),
    date_start_dev: prepare_time(date_start_dev),
    date_end_dev: prepare_time(date_end_dev),
    date_start_test: prepare_time(date_start_test),
    date_end_test: prepare_time(date_end_test),
  )

  puts record.attributes unless record.id
end
